import React from 'react';
import './TeamLineupOverlay.css';

const TeamLineupOverlay = () => {
  // Sample data - can be made dynamic later
  const teamData = {
    championship: "WORLD CHAMPIONSHIP",
    location: "LONDON",
    stage: "WORLDS FINAL",
    teamName: "T1",
    region: "LCK#4",
    logo: "https://via.placeholder.com/120x120/ffffff/000000?text=T1",
    players: [
      {
        name: "Zeus",
        role: "TOP",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Zeus"
      },
      {
        name: "Oner", 
        role: "JNG",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Oner"
      },
      {
        name: "Faker",
        role: "MID", 
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Faker"
      },
      {
        name: "Gumayusi",
        role: "ADC",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Gumayusi"
      },
      {
        name: "Keria",
        role: "SUP",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Keria"
      }
    ],
    matchHistory: [
      { stage: "SWISS STAGE", round: "R1", opponent: "TES", result: "W" },
      { stage: "SWISS STAGE", round: "R2", opponent: "PNG", result: "W" },
      { stage: "SWISS STAGE", round: "R3", opponent: "BLG", result: "W" },
      { stage: "SWISS STAGE", round: "R4", opponent: "G2", result: "W", score: "2:0" },
      { stage: "QUARTERFINALS", round: "", opponent: "TES", result: "W", score: "3:0" },
      { stage: "SEMIFINALS", round: "", opponent: "GEN", result: "W", score: "3:1" }
    ]
  };

  return (
    <div className="team-lineup-overlay">
      {/* Background and frame */}
      <div className="overlay-background">
        {/* Header section */}
        <div className="header-section">
          <div className="championship-info">
            <div className="championship-text">{teamData.championship}</div>
            <div className="location-text">{teamData.location}</div>
            <div className="stage-text">{teamData.stage}</div>
          </div>

          <div className="team-info">
            <div className="team-logo">
              <img src={teamData.logo} alt={teamData.teamName} />
            </div>
            <div className="team-name">{teamData.teamName}</div>
            <div className="team-region">{teamData.region}</div>
          </div>

          <div className="league-logo">
            <div className="league-text">LEAGUE<span className="of-text">OF</span></div>
            <div className="legends-text">LEGENDS</div>
          </div>
        </div>

        {/* Player lineup section */}
        <div className="players-section">
          {teamData.players.map((player, index) => (
            <div key={index} className="player-card">
              <div className="player-role-icon">
                <div className="role-symbol"></div>
              </div>
              <div className="player-name">{player.name}</div>
              <div className="player-image">
                <img src={player.image} alt={player.name} />
              </div>
            </div>
          ))}
        </div>

        {/* Tournament progression section */}
        <div className="tournament-section">
          {teamData.matchHistory.map((match, index) => (
            <div key={index} className="match-info">
              <div className="stage-name">{match.stage}</div>
              <div className="match-details">
                {match.round && <span className="round">{match.round}</span>}
                <span className="vs-text">VS {match.opponent}</span>
                {match.score && <span className="score">{match.score}</span>}
              </div>
            </div>
          ))}
        </div>

        {/* Decorative frame elements */}
        <div className="frame-top-left"></div>
        <div className="frame-top-right"></div>
        <div className="frame-bottom-left"></div>
        <div className="frame-bottom-right"></div>
        <div className="grid-lines"></div>
      </div>
    </div>
  );
};

export default TeamLineupOverlay;
